    "job_description": "Everlight Solar is seeking a skilled React Developer who will will help to produce scalable software solutions. As a React Developer, you play a key role in deployment and support of cutting-edge applications. This will be a full-time, work-from-home \"remote\" position.\n\nMust own a Mac computer and be fluent with the Apple ecosystem of software (iOS, macOS, iWork, etc.)\n\nEverlight Solar is a rapidly growing company and the leader of solar energy in the Midwest. We offer a unique experience that fosters individual growth and rewards performance. Our culture at Everlight is extremely important to us. The work environment is fast-paced and dynamic. We value teamwork, quality, innovation, and customer success. Our ideal candidate is self-motivated, detail-oriented, has excellent problem-solving abilities, is passionate about delivering results on-time, exceeding expectations, and ensuring success for our teams.\n\nResponsibilities:\n• Create new React applications\n• Participate in the design and creation of scalable software\n• Support live applications with updates and new features\n• Proactively seeks and fixes defects\n• Contributes to design, code and project documents reviews\n• Communicate with clients and team members about best practices for building efficient, extensible, standards-based applications and apps\n\nRequirements:\n• Minimum 2+ years of experience building scalable web applications\n• Minimum 2+ years of professional experience with React.JS and its core principles\n• Minimum 2+ years of direct frontend experience\n• Hands on experience with popular React.Js workflows\n• Hands-on experience working with SQL databases\n• Experience with data modeling\n• Proven troubleshooting and debugging skills\n• A documented history of successfully driving projects to completion\n• A demonstrated ability to understand and articulate complex requirements\n• Excellent project management skills and a positive attitude\n• Must demonstrate exceptional verbal and written communication skills\n• Must demonstrate ability to communicate effectively at all levels of the organization\n\nBenefits:\n• Health Insurance\n• Dental Insurance\n• Vision Insurance\n• Life Insurance\n• PTO\n• Sick and Safe Time\n• Paid Holidays Off\n\nSalary: $70,000-$100,000/ year\n\nEverlight Solar is proudly an Equal Opportunity Employer. We value diversity of all types and are excited to work with talented individuals from a wide range of backgrounds. Everlight is committed to inclusion and we invite people of any race, creed, color, national origin, ancestry, marital status, sexual orientation, gender identity or expression, disability, nationality or sex, age groups (18+), and levels of education to apply. Authorized to work in the US and background check required.",
