    "job_description": "Who we are\n\nGame7 is an Autonomous GameFi Institution whose treasury is managed and deployed by the community. Our mission is to make web3 gaming sustainable by accelerating the industry towards collaboration, unified standards, open source innovation and having fun.\n\nTo achieve this, both BitDAO and Forte have committed $500m to our treasury. Our community then helps decide how to deploy strategic capital towards both Investments and Grants that help drive the ecosystem forward.\n\nAs a community, we are passionate about crypto, gaming and are comprised of industry leaders and blockchain experts, who believe there are better ways to build distributed organizations. Our community consists of diverse, talented and intelligent members who’s contributions to the ecosystem help define their governance capabilities.\n\nWe’re looking for the next generation of leaders and doers who have a passion for crypto and are looking to influence the future of DAOs, DeFi, Web3 and GameFi. If you’re a self-starter, believe in autonomy and ownership, then we encourage you to apply for this role.\n\nYour Opportunity\n\nWe are seeking an experienced React Developer to join our team. As a React Developer, you will be responsible for developing and maintaining web applications using the React framework. You will collaborate with our design and product teams to create user-friendly and responsive interfaces that provide a seamless user experience. If you have experience with modern front-end development technologies and a passion for building high-quality web applications, we encourage you to apply.\n\nTo be an ideal candidate, you should be comfortable using front-end technologies fused with web3 to develop robust and efficient web apps and dApps.\n\nYour craft\n• At least 3 years of experience in React development.\n• Knowledge of web3 and Ethereum development tools and libraries, such as web3.js and ethers.js.\n• Self-driven with the ability to deliver results with minimal supervision.\n• Strong proficiency in JavaScript, HTML, CSS, and related web technologies.\n• Experience with modern front-end development tools, including Node.js, npm, Vite, and Babel.\n• Understanding of React principles, component lifecycle, and state management libraries such as Redux or Zustand.\n• Familiarity with RESTful APIs and asynchronous request handling.\n• Experience with version control systems such as Git.\n• Ability to write efficient, reusable, and scalable code.\n• Strong problem-solving and debugging skills.\n• Excellent written and verbal communication skills.\n• Proficiency in advanced animation libraries like GSAP, Lottie, Three.js, Anime.js, and Framer Motion to create sophisticated and high-performance website animations.\n\nIf you think you have valuable experience to bring to the organization, but don’t necessarily meet all of the criteria for the role, we still want to hear from you. We consider all applications.\n\nExtra credit\n• Experience working in a fast-growing startup environment.\n• Experience with TypeScript.\n• Experience with testing frameworks such as Jest, React-testing library or Vitest.\n• Familiarity with GraphQL and Apollo Client.\n• Familiarity with TailwindCSS.\n• Experience with back-end technologies such as Node.js and Express.js.\n• Good understanding of blockchain technology and its underlying principles.\n• Familiarity with DeFi protocols and applications.\n• Knowledge of Solidity and smart contract development on Ethereum and other EVM-compatible blockchains.\n• Familiarity with various EVM-compatible blockchains, their differences, and their respective strengths and weaknesses.\n• Experience with developing games or other interactive applications on blockchain.\n• Contributions to open-source blockchain projects\n• Bachelor's degree in computer science, software engineering, or a related field.\n\nWhy work with us?\n\nWe do things a little differently here at Game7, as you’d expect from the blockchain. We promise a culture of flexibility, autonomy, and the freedom to contribute to the wider Web3 ecosystem.\n\nAlso: a fully remote working environment. Our compensation packages are reflective of the experience and value you bring to the organization and individual projects.\n• Base pay USDC, paid monthly\n• Work Supplies, HW & Home Office Equipment\n• Co-working space or home office-related expenses\n• Any learning or education materials related to work\n• Travel related expenses that are related to work\n• Any expenses related to food and entertainment for work\n• Any expenses related to both physical or mental health and well-being\n\nWe’re committed to fostering a progressive work environment that’s centered on forgiveness, empathy, belonging, and psychological well-being. Game7 is an equal opportunities workplace that doesn’t discriminate based on race, ethnicity, gender, ancestry, national origin, religion, sex, sexual orientation, gender identity, age disability, veteran status, genetic information, marital status, or any other legally protected status.",
